import logo from './logo.png';
import {React,useEffect, useState} from 'react';
import '../../App.css';
import {Route, Redirect, useHistory} from 'react-router-dom'

function Home() {

  const history = useHistory();
  function Redirect(page){

    history.push("/"+page);
    return <Redirect    to={{
      pathname:'/'+page
        }}/>
  }

  return (
    <div className="Home">
      <div className="Top">
        <div>
          <button className="button button1">התנתק</button>
          <button onClick={()=>{Redirect('List')}} className="button button1">רשימת הבקשות שלי</button>
          <button onClick={()=>{Redirect('Home')}} className="button button1">דף הבית</button>
        </div>
        <div className="row">
          <div>שם משתמש</div>
          <img src={logo} alt="Logo"/>
        </div>
      </div>
      <div className="login" >
        <p staly={{marginBottom: '30px'}}>PartnerTAU ברוכים הבאים לאתר</p>
        <div className="Col" >
            <div><input type ="text"></input>שם קורס</div>
            <div>או</div>
            <div><input type ="text"></input>מספר קורס</div>
        </div>
      </div>
      <button onClick={()=>{Redirect('Courses')}} className="button button1">חפש</button>
    </div>
  );
}

export default Home;
